import '../../../../../../../styles/action-sidebar.css'

export default function CustomerCouponSidebar() {
    return (
        <div className='CustomerCouponSidebar'>
            <div className='action-sidebar'>
                <button className='action-sidebar-button'>Find By Category</button>
                <div className='action-sidebar-button-seperator'></div>
                <button className='action-sidebar-button'>Find By Price</button>
            </div>
        </div>
    )
}
